import { Navbar, Container, Row, Col } from 'react-bootstrap'
import logo from '../../decentorage.png';


function User() {
    cons
    return (
        <Navbar className = "Navbar">
            <Container fluid>
                <Row>
                    <Col sm={3}><img src={logo} alt="Logo" className='logo'/></Col>
                </Row>
                <Row><Col sm={7}></Col></Row>
                <Row>
                    <Col sm={2}>
                        <Button size="lg" onClick={logOut}>sign in</Button>
                    </Col>
                </Row>
            </Container>
        </Navbar>
    );
}

export default User;
